		this.elastikS2 = 0;
		this.factor = 0.05;
		this.depass = 0.65;
		this.coolNoise = 130;
		function main() {
			indic = this.coolL;
			light.bind(this)();
			nois.bind(this)();
			this.coolZ--;
			this.coolD--;
			this.coolL--;
			if (this.coolZ <= 0) {
				createZombie.bind(this)();
				this.coolNoise = random(130);
				this.coolZ = random(15) + 5;
			}
			if (this.coolD <= 0) {
				createDirt.bind(this)();
				this.coolD = random(5) + 2;
			}
			if (this.coolL <= 0) {
				createLittle.bind(this)();
				this.coolL = random(20) + 2;
			}
			shakeM.bind(this)();
			moveZombie.bind(this)();
			moveDirt.bind(this)();
			moveLittle.bind(this)();
		}
		function light() {
			this.mov.cam.lamp.alpha = this.mov.cam.lamp.alpha + this.lightVit;
			this.mov.cam.lamp2.alpha = this.mov.cam.lamp2.alpha + this.lightVit;
			let _loc1_ = random(150);
			if (_loc1_ >= 118) {
				this.lightVit = -0.30;
			} else {
				this.lightVit = 0.10;
			}
			if (this.mov.cam.lamp.alpha >= 0.95) {
				this.mov.cam.lamp.alpha = 0.95;
				this.mov.cam.lamp2.alpha = 0.95;
			}
		}
		function nois() {
			if (this.coolNoise >= 118) {
				this.noise.alpha = 1;
			} else {
				this.noise.alpha = 0.06;
			}
		}
		function createZombie() {
			this.zNum = this.zNum + 1 % this.zMax;
			let clip = new lib.zombClip();
			clip.setTransform(0,-0.5);
		
			let s = random(90) + 40;

			clip.name = "zombClip" + this.zNum;

			clip.scaleX = 1+(s/100);
			clip.scaleY = 1+(s/100);
			clip.x = 600;
			clip.y = 100 + clip.scaleX / 2;
			clip.alpha = 100;

			clip.filters = [new cjs.BlurFilter(s - 100, 0)];
			this.mov.cam.addChild(clip);
			this.mov.y = this.mov.y + s / 10;
			if (s >= 100) {
				this.mov.gotoAndPlay("start1");
			}
			if (s < 100 && s >= 60) {}
			this.zList.push(clip);
			return clip;
		}
		function moveZombie() {
			let i = 0;
			while (i < this.zList.length) {
				let clip = this.zList[i];
				clip.vitx = clip.scaleX * 30;
				clip.x = clip.x - clip.vitx;
				if (clip.x <= -300) {
					this.mov.cam.removeChild(clip);
					this.zList.splice(i, 1);
					i--;
				}
				i++;
			}
		}
